import React from "react"

class AssignmentsData extends React.Component {
    constructor() {
        super()
        this.state= {
           complete: false
        }
    }

    changeChecked= () => {
        this.setState({
            complete: this.state.complete ? false : true
        })
    }

    render() {
        return(
            <div className="assignmentsData-item">
                <label className="assignmentsData-item-btn">
                    Complete Assignment
                </label>
                <input type="checkbox" className="assignmentsData-item-complete" checked={this.state.complete} onClick={this.changeChecked}/>
                <h2>{this.props.title}</h2>
                <p>Assignment Given On: {this.props.setOn}</p>
                <p>Assignment Deadline: {this.props.deadline}</p>
                <p>Assignment ID: {this.props.id}</p>
            </div>
        )
    }
}
export default AssignmentsData
